import React from 'react';
import ButtonStyle from './button.module.scss';

interface OwnProps {
    onClick: () => void;
    color: 'purple' | 'orange';
}

const Button: React.FC<OwnProps> = (props) => {
    return (
        <button className={ButtonStyle.Button} onClick={props.onClick}>{props.children}</button>
    )
}


export default Button;
